const texteUnAng="Hi, I'm Aurélien. I take great pleasure in coding.";

const texteDeuxAng =(
  <>
    I have a particular passion for
    <span className='text-jaune font-bold '> Front-end </span> 
    development.
  </>
);

const texteTroisAng="as it allows me to express my creativity while constantly encountering new challenges."

const texteQuatreAng =(
  <>
   That's why I enjoy recreating website 
   <span className='text-jaune font-bold '> designs </span>
    I discover, especially when they showcase interesting 
    <span className='text-jaune font-bold'> UI </span>
     or 
     <span className='text-jaune font-bold'> UX </span>
     concepts.
  </>
);

const texteUnFr ="Salut, je suis Aurélien. Je prends beaucoup de plaisir à coder.";

const texteDeuxFr =(
  <>
    J’ai une passion particulière pour le développement
    <span className='text-jaune font-bold '> Front-end, </span> 
    .
  </>
);

const texteTroisFr="car cela me permet d’exprimer ma créativité tout en relevant sans cesse de nouveaux défis."

const texteQuatreFr =(
  <>
   C'est pourquoi j'apprécie de reproduire des  
   <span className='text-jaune font-bold '> integrations </span>
    de sites web que je découvre, en particulier lorsqu'ils présentent une 
    <span className='text-jaune font-bold'> UI </span>
     ou une 
     <span className='text-jaune font-bold'> UX </span>
     intéressante.
  </>
);

const tabTexteAbout ={
  fr:[texteUnFr,texteDeuxFr,texteTroisFr,texteQuatreFr],
  ang:[texteUnAng,texteDeuxAng,texteTroisAng,texteQuatreAng]
}

export default tabTexteAbout;
